import React from "react";
import EcoIcon from "@material-ui/icons/Eco";
import { makeStyles } from "@material-ui/core/styles";
import {
	List,
	ListItem,
	ListItemText,
	ListItemAvatar,
	Avatar,
} from "@material-ui/core";

const DietList = ({ diets }) => {
	return (
		<div>
			<List>
				{diets.map((diet) => (
					<ListItem>
						<ListItemAvatar>
							<Avatar>
								<EcoIcon />
							</Avatar>
						</ListItemAvatar>
						<ListItemText primary={diet} />
					</ListItem>
				))}
			</List>
		</div>
	);
};

export default DietList;
